import React from 'react';
import PropTypes from 'prop-types';
import gql from 'graphql-tag';

const propTypes = {};
const defaultProps = {};

const Tooltip = ({stock}) => {
  return (
    <div>
      Custom tooltip
    </div>
  )
};

Tooltip.propTypes = propTypes;
Tooltip.defaultProps = defaultProps;

Tooltip.fragments = {};

export default Tooltip;
